  false,\n\t\"url\": null,\n\t\"notes\": \"This proposal describes a rehabilitation
  program for up to 3,000 acres of marsh vegetation. The primary objectives are: 1)
  to chemically control the dense stands of phragmites that are choking out plant
  species needed by wildlife for food and habitat. 2) Reduce the severe fire hazard
  that is present due to phragmites. Prime Hook National Wildlife Refuge is divided
  into four management units. Marsh vegetation rehabilitation will be conducted in
  Unit II (up to 1, 000 acres) and in Unit III (up to 2,000 acres).\",\n\t\"license_title\":
